import React, { Component } from 'react'

export default class Search extends Component {
    constructor(props){
        super(props);
        this.state = {
            what: this.props.match.params.what,
            where: this.props.match.params.where
        }
    }
    render() {
        return (
            <div>
                <h1>`What: $`</h1>
                <h1>`Where: ${this.state.where}`</h1>
            </div>
        )
    }
}
